class Solution {

    /**
     * @param Integer $n
     * @param Integer[] $sick
     * @return Integer
     */
    function numberOfSequence($n, $sick) {
        $mod = 1000000007;
        $totalWays = 1;
        $prev = -1;
        $segments = [];

        for ($i = 0; $i < count($sick); $i++) {
            if ($prev != -1) {
                $segments[] = $sick[$i] - $prev - 1;
            }
            $prev = $sick[$i];
        }
        $segments[] = $n - end($sick) - 1;

        foreach ($segments as $gap) {
            if ($gap > 0) {
                $totalWays = ($totalWays * $this->calcWays($gap)) % $mod;
            }
        }

        return $totalWays;
    }

    private function calcWays($gap) {
        $a = 1;
        $b = 1;

        for ($i = 2; $i <= $gap; $i++) {
            $c = $a + $b;
            $a = $b;
            $b = $c;
        }

        return $b;
    }
}
